import React, { useState, useEffect } from 'react';
import { useNavigate } from 'react-router-dom';
import './FirstTimer.css';

const FirstTimer = () => {
  const navigate = useNavigate();
  const [selectedPropertyTypes, setSelectedPropertyTypes] = useState([]);
  const [selectedLocations, setSelectedLocations] = useState([]);

  // Check if user should be on this page
  useEffect(() => {
    const userType = localStorage.getItem('userType');
    const isLoggedIn = localStorage.getItem('isLoggedIn');
    
    if (!isLoggedIn) {
      navigate('/login');
      return;
    }
    
    // Only Free and Premium users should access FirstTimer
    if (userType === 'agent' || userType === 'sysadmin') {
      navigate('/dashboard');
      return;
    }
  }, [navigate]);

  const propertyTypes = [
    { id: 'warehouse', name: 'Warehouse', icon: 'üè≠' },
    { id: 'factory', name: 'Factory', icon: 'üè¢' },
    { id: 'office', name: 'Office', icon: 'üè¢' },
    { id: 'retail', name: 'Retail Space', icon: 'üè™' },
    { id: 'land', name: 'Land', icon: 'üåç' }
  ];

  const locationPreferences = [
    { id: 'cbd', name: 'Central Business District (CBD)', icon: 'üèôÔ∏è' },
    { id: 'industrial', name: 'Industrial Parks (e.g., Jurong, Woodlands)', icon: 'üè≠' },
    { id: 'city-fringe', name: 'City Fringe', icon: 'üèòÔ∏è' },
    { id: 'general', name: 'General Regions', icon: 'üó∫Ô∏è' }
  ];

  const togglePropertyType = (propertyId) => {
    setSelectedPropertyTypes(prev => 
      prev.includes(propertyId) 
        ? prev.filter(id => id !== propertyId)
        : [...prev, propertyId]
    );
  };

  const toggleLocation = (locationId) => {
    setSelectedLocations(prev => 
      prev.includes(locationId) 
        ? prev.filter(id => id !== locationId)
        : [...prev, locationId]
    );
  };

  const handleSaveAndContinue = () => {
    // Save user preferences to backend/localStorage
    const userPreferences = {
      propertyTypes: selectedPropertyTypes,
      locations: selectedLocations,
      completed: true
    };
    
    localStorage.setItem('userPreferences', JSON.stringify(userPreferences));
    
    // Navigate to main dashboard
    navigate('/dashboard');
  };

  const handleSkip = () => {
    // Mark as completed without preferences
    const userPreferences = {
      propertyTypes: [],
      locations: [],
      completed: true
    };
    
    localStorage.setItem('userPreferences', JSON.stringify(userPreferences));
    
    // Navigate to main dashboard
    navigate('/dashboard');
  };

  return (
    <div className="first-timer-container">
      <div className="first-timer-header">
        <div className="header-text">First Time Login (Interest Page)</div>
        <div className="logo">
          <span className="logo-icon">üè†</span>
          <span className="logo-text">Valuez</span>
        </div>
      </div>

      <div className="first-timer-content">
        <div className="welcome-section">
          <h1 className="welcome-title">Welcome! Tell Us About Your Interests</h1>
          <p className="welcome-subtitle">
            Customize your property search by selecting the types of properties and locations you're interested in.
          </p>
        </div>

        <div className="interests-section">
          <div className="property-types-section">
            <h2 className="section-title">Property Types</h2>
            <div className="selection-cards">
              {propertyTypes.map((property) => (
                <div
                  key={property.id}
                  className={`selection-card ${selectedPropertyTypes.includes(property.id) ? 'selected' : ''}`}
                  onClick={() => togglePropertyType(property.id)}
                >
                  <div className="card-icon">{property.icon}</div>
                  <div className="card-text">{property.name}</div>
                </div>
              ))}
            </div>
          </div>

          <div className="location-preferences-section">
            <h2 className="section-title">Location Preferences</h2>
            <div className="selection-cards">
              {locationPreferences.map((location) => (
                <div
                  key={location.id}
                  className={`selection-card ${selectedLocations.includes(location.id) ? 'selected' : ''}`}
                  onClick={() => toggleLocation(location.id)}
                >
                  <div className="card-icon">{location.icon}</div>
                  <div className="card-text">{location.name}</div>
                </div>
              ))}
            </div>
          </div>
        </div>

        <div className="action-buttons">
          <button 
            className="save-continue-btn"
            onClick={handleSaveAndContinue}
          >
            Save Interests & Continue
          </button>
          <button 
            className="skip-btn"
            onClick={handleSkip}
          >
            Skip
          </button>
        </div>
      </div>
    </div>
  );
};

export default FirstTimer;
